import styled from "styled-components";
import React from "react";

const PlaylistsContainer = styled.div`
    display: flex;
    flex-direction: column;
    align-items: center;
`

export default class Playlists extends React.Component {
    state = {
        playlists: [
            {
                "id": "3cec7781-e22f-49d7-b436-f0d31c72b8ef",
                "name": "postpunk"
            },
            {
                "id": "8b67e218-ef00-4b25-8e19-9a5c5baa1423",
                "name": "indie"
            },
            {
                "id": "d1a61916-e211-4320-9de6-2c4bd370956c",
                "name": "noise"
            },
            {
                "id": "e3a936a6-91b8-44f0-b629-37051bba78e4",
                "name": "rap"
            },
            {
                "id": "c9a0678d-0f04-4dff-81d2-db578155d81d",
                "name": "reggae"
            },
            {
                "id": "12a08a00-e731-40c3-ba6f-ffd51b0e85e6",
                "name": "surf-music"
            },
            {
                "id": "7272f575-0291-4540-bd0d-d8bf2d479093",
                "name": "aleatórias"
            },
            {
                "id": "a6422a0a-d3e2-411c-94f5-01ff95300ac4",
                "name": "rock"
            },
            {
                "id": "1d8bfb82-ecf6-43c2-8f4e-22d6b21db2a9",
                "name": "mpb"
            },
            {
                "id": "1c6c2ce0-6a57-4897-ab4c-e38175386772",
                "name": "doideira-doida"
            }
        ]
    }
    
    render() {
        const playlists = this.state.playlists.map(playlist => {
            return <p>{playlist.name}</p>
        })

        return (
            <PlaylistsContainer>
                {playlists}
                <button onClick={() => this.props.mudarPagina("playlistDetail")}>Abrir Playlist</button>
            </PlaylistsContainer>
        );
    }
}
